import React from "react";
import { useLocation, useParams } from "react-router";

const RouterContact = () => {

    let {fname} = useParams();
    let getLocate = useLocation();

    return (
        <>
            <h1>This is the Contact webpage {fname}</h1>
        </>
    );
}

export default RouterContact;
